// State
let cart = [];
let filters = {
  category: '全部',
  priceRange: [0, 1000],
  sizes: [],
  colors: []
};

// DOM Elements
const productsGrid = document.getElementById('productsGrid');
const productsCount = document.getElementById('productsCount');
const cartBtn = document.getElementById('cartBtn');
const cartBadge = document.getElementById('cartBadge');
const cartSidebar = document.getElementById('cartSidebar');
const closeCartBtn = document.getElementById('closeCartBtn');
const cartItems = document.getElementById('cartItems');
const cartFooter = document.getElementById('cartFooter');
const cartItemCount = document.getElementById('cartItemCount');
const productModal = document.getElementById('productModal');
const modalOverlay = document.getElementById('modalOverlay');
const modalCloseBtn = document.getElementById('modalCloseBtn');
const modalBody = document.getElementById('modalBody');
const filterSidebar = document.getElementById('filterSidebar');
const closeFilterBtn = document.getElementById('closeFilterBtn');
const mobileMenuBtn = document.getElementById('mobileMenuBtn');
const filterBtnMobile = document.getElementById('filterBtnMobile');
const overlay = document.getElementById('overlay');

// Filter products
function filterProducts() {
  return PRODUCTS.filter(product => {
    // Category filter
    if (filters.category !== '全部' && product.category !== filters.category) {
      return false;
    }

    // Price filter
    if (product.price < filters.priceRange[0] || product.price > filters.priceRange[1]) {
      return false;
    }

    // Size filter
    if (filters.sizes.length > 0 && !filters.sizes.some(size => product.sizes.includes(size))) {
      return false;
    }

    // Color filter
    if (filters.colors.length > 0 && !filters.colors.some(color => product.colors.includes(color))) {
      return false;
    }

    return true;
  });
}

// Render products
function renderProducts() {
  const filteredProducts = filterProducts();
  productsCount.textContent = `(${filteredProducts.length})`;

  if (filteredProducts.length === 0) {
    productsGrid.innerHTML = `
      <div class="no-products">
        <p class="no-products-title">未找到符合的商品</p>
        <p class="no-products-text">請調整篩選條件</p>
      </div>
    `;
    return;
  }

  productsGrid.innerHTML = filteredProducts.map(product => {
    const discount = product.originalPrice 
      ? Math.round(((product.originalPrice - product.price) / product.originalPrice) * 100)
      : 0;

    const stars = Array(5).fill(0).map((_, i) => 
      `<svg class="star ${i < Math.floor(product.rating) ? 'filled' : ''}" viewBox="0 0 24 24">
        <polygon points="12 2 15.09 8.26 22 9.27 17 14.14 18.18 21.02 12 17.77 5.82 21.02 7 14.14 2 9.27 8.91 8.26 12 2" />
      </svg>`
    ).join('');

    return `
      <div class="product-card" data-product-id="${product.id}">
        <div class="product-image-wrapper">
          <img src="${product.image}" alt="${product.name}" class="product-image">
          ${discount > 0 ? `<div class="product-discount">-${discount}%</div>` : ''}
        </div>
        <div class="product-info">
          <h3 class="product-name">${product.name}</h3>
          <p class="product-category">${product.category}</p>
          <div class="product-rating">
            ${stars}
            <span class="product-reviews">(${product.reviews})</span>
          </div>
          <div class="product-price-wrapper">
            <span class="product-price">$${product.price}</span>
            ${product.originalPrice ? `<span class="product-original-price">$${product.originalPrice}</span>` : ''}
          </div>
        </div>
      </div>
    `;
  }).join('');

  // Add click event to product cards
  document.querySelectorAll('.product-card').forEach(card => {
    card.addEventListener('click', () => {
      const productId = parseInt(card.dataset.productId);
      const product = PRODUCTS.find(p => p.id === productId);
      showProductModal(product);
    });
  });
}

// 計算滾動條寬度以防止背景抖動
function getScrollbarWidth() {
  return window.innerWidth - document.documentElement.clientWidth;
}

// Show product modal
function showProductModal(product) {
  const scrollbarWidth = getScrollbarWidth();
  document.body.style.setProperty('--scrollbar-width', scrollbarWidth + 'px');
  document.body.classList.add('modal-open');
  const discount = product.originalPrice 
    ? Math.round(((product.originalPrice - product.price) / product.originalPrice) * 100)
    : 0;

  const stars = Array(5).fill(0).map((_, i) => 
    `<svg class="star ${i < Math.floor(product.rating) ? 'filled' : ''}" viewBox="0 0 24 24">
      <polygon points="12 2 15.09 8.26 22 9.27 17 14.14 18.18 21.02 12 17.77 5.82 21.02 7 14.14 2 9.27 8.91 8.26 12 2" />
    </svg>`
  ).join('');

  modalBody.innerHTML = `
    <div class="modal-image">
      <img src="${product.image}" alt="${product.name}">
    </div>
    <div class="modal-details">
      <div class="modal-category">${product.category}</div>
      <h2 class="modal-name">${product.name}</h2>
      <div class="modal-rating">
        ${stars}
        <span class="modal-rating-text">${product.rating} (${product.reviews} 評價)</span>
      </div>
      <div class="modal-price-wrapper">
        <span class="modal-price">$${product.price}</span>
        ${product.originalPrice ? `
          <span class="modal-original-price">$${product.originalPrice}</span>
          <span class="modal-discount">${discount}% OFF</span>
        ` : ''}
      </div>
      <p class="modal-description">${product.description}</p>
      <div class="modal-features">
        <h3 class="modal-features-title">主要特色：</h3>
        <ul class="modal-features-list">
          ${product.features.map(f => `<li>${f}</li>`).join('')}
        </ul>
      </div>
      <div class="modal-section">
        <h3 class="modal-section-title">選擇尺寸：</h3>
        <div class="modal-size-options">
          ${product.sizes.map(size => `
            <button class="size-btn modal-size-btn" data-size="${size}">${size}</button>
          `).join('')}
        </div>
      </div>
      <div class="modal-section">
        <h3 class="modal-section-title">數量：</h3>
        <div class="modal-quantity">
          <button class="quantity-btn" id="decreaseQty">
            <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
              <line x1="5" y1="12" x2="19" y2="12"></line>
            </svg>
          </button>
          <span class="quantity-value" id="modalQty">1</span>
          <button class="quantity-btn" id="increaseQty">
            <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
              <line x1="12" y1="5" x2="12" y2="19"></line>
              <line x1="5" y1="12" x2="19" y2="12"></line>
            </svg>
          </button>
        </div>
      </div>
      <button class="add-to-cart-btn" id="addToCartBtn">
        <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
          <circle cx="9" cy="21" r="1"></circle>
          <circle cx="20" cy="21" r="1"></circle>
          <path d="M1 1h4l2.68 13.39a2 2 0 0 0 2 1.61h9.72a2 2 0 0 0 2-1.61L23 6H6"></path>
        </svg>
        加入購物車
      </button>
      

    </div>
  `;

  let selectedSize = '';
  let quantity = 1;

  // Size selection
  document.querySelectorAll('.modal-size-btn').forEach(btn => {
    btn.addEventListener('click', () => {
      document.querySelectorAll('.modal-size-btn').forEach(b => b.classList.remove('active'));
      btn.classList.add('active');
      selectedSize = btn.dataset.size;
    });
  });

  // Quantity controls
  document.getElementById('decreaseQty').addEventListener('click', () => {
    if (quantity > 1) {
      quantity--;
      document.getElementById('modalQty').textContent = quantity;
    }
  });

  document.getElementById('increaseQty').addEventListener('click', () => {
    quantity++;
    document.getElementById('modalQty').textContent = quantity;
  });

  // Add to cart
  document.getElementById('addToCartBtn').addEventListener('click', () => {
    if (!selectedSize) {
      alert('請選擇尺寸');
      return;
    }

    const existingItem = cart.find(item => item.product.id === product.id && item.size === selectedSize);
    if (existingItem) {
      existingItem.quantity += quantity;
    } else {
      cart.push({ product, size: selectedSize, quantity });
    }

    updateCart();
    closeModal();
  });



  productModal.classList.add('open');
}

function closeModal() {
  productModal.classList.remove('open');
  document.body.classList.remove('modal-open');
}

// Update cart
function updateCart() {
  const totalItems = cart.reduce((sum, item) => sum + item.quantity, 0);
  cartBadge.textContent = totalItems;
  cartBadge.classList.toggle('hidden', totalItems === 0);
  cartItemCount.textContent = cart.length;

  if (cart.length === 0) {
    cartItems.innerHTML = `
      <div class="cart-empty">
        <p class="cart-empty-title">購物車是空的</p>
        <p class="cart-empty-text">開始選購商品吧！</p>
      </div>
    `;
    cartFooter.innerHTML = '';
    return;
  }

  cartItems.innerHTML = cart.map((item, index) => `
    <div class="cart-item">
      <img src="${item.product.image}" alt="${item.product.name}" class="cart-item-image">
      <div class="cart-item-details">
        <h3 class="cart-item-name">${item.product.name}</h3>
        <p class="cart-item-size">尺寸: ${item.size}</p>
        <p class="cart-item-price">$${item.product.price}</p>
        <div class="cart-item-controls">
          <button class="cart-qty-btn" data-index="${index}" data-action="decrease">
            <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
              <line x1="5" y1="12" x2="19" y2="12"></line>
            </svg>
          </button>
          <span class="cart-item-qty">${item.quantity}</span>
          <button class="cart-qty-btn" data-index="${index}" data-action="increase">
            <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
              <line x1="12" y1="5" x2="12" y2="19"></line>
              <line x1="5" y1="12" x2="19" y2="12"></line>
            </svg>
          </button>
          <button class="cart-remove-btn" data-index="${index}">
            <svg class="icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
              <polyline points="3 6 5 6 21 6"></polyline>
              <path d="M19 6v14a2 2 0 0 1-2 2H7a2 2 0 0 1-2-2V6m3 0V4a2 2 0 0 1 2-2h4a2 2 0 0 1 2 2v2"></path>
            </svg>
          </button>
        </div>
      </div>
    </div>
  `).join('');

  // Cart item controls
  document.querySelectorAll('.cart-qty-btn').forEach(btn => {
    btn.addEventListener('click', () => {
      const index = parseInt(btn.dataset.index);
      const action = btn.dataset.action;
      
      if (action === 'decrease' && cart[index].quantity > 1) {
        cart[index].quantity--;
      } else if (action === 'increase') {
        cart[index].quantity++;
      }
      
      updateCart();
    });
  });

  document.querySelectorAll('.cart-remove-btn').forEach(btn => {
    btn.addEventListener('click', () => {
      const index = parseInt(btn.dataset.index);
      cart.splice(index, 1);
      updateCart();
    });
  });

  // Calculate totals
  const subtotal = cart.reduce((sum, item) => sum + item.product.price * item.quantity, 0);
  const shipping = subtotal > 200 ? 0 : 15;
  const total = subtotal + shipping;

  cartFooter.innerHTML = `
    <div class="cart-summary">
      <div class="cart-summary-row">
        <span class="cart-summary-label">小計</span>
        <span class="cart-summary-value">$${subtotal.toFixed(2)}</span>
      </div>
      <div class="cart-summary-row">
        <span class="cart-summary-label">運費</span>
        <span class="cart-summary-value">${shipping === 0 ? '免運' : `$${shipping.toFixed(2)}`}</span>
      </div>
      ${shipping > 0 ? '<p class="cart-shipping-note">滿 $200 免運費</p>' : ''}
    </div>
    <div class="cart-total">
      <span class="cart-total-label">總計</span>
      <span class="cart-total-value">$${total.toFixed(2)}</span>
    </div>
    <button class="checkout-btn">結帳</button>
  `;
}

