// 結帳表單
function showCheckoutForm(cartItems, total) {
  const checkoutHTML = `
    <h2>結帳</h2>
    <form id="checkoutForm" class="checkout-form">
      <div class="checkout-section">
        <h3>收貨資訊</h3>
        <div class="checkout-form-group">
          <label>姓名</label>
          <input type="text" name="name" placeholder="請輸入姓名" required>
        </div>
        <div class="checkout-row">
          <div class="checkout-form-group">
            <label>電子郵件</label>
            <input type="email" name="email" placeholder="請輸入電子郵件" required>
          </div>
          <div class="checkout-form-group">
            <label>電話</label>
            <input type="tel" name="phone" placeholder="請輸入電話" required>
          </div>
        </div>
        <div class="checkout-form-group">
          <label>地址</label>
          <input type="text" name="address" placeholder="請輸入收貨地址" required>
        </div>
      </div>

      <div class="checkout-section">
        <h3>配送方式</h3>
        <div class="checkout-form-group">
          <label>
            <input type="radio" name="shipping" value="standard" checked> 標準配送 (3-5 個工作天)
          </label>
          <label>
            <input type="radio" name="shipping" value="express"> 快速配送 (1-2 個工作天) +$50
          </label>
        </div>
      </div>

      <div class="checkout-section">
        <h3>付款方式</h3>
        <div class="checkout-form-group">
          <label>
            <input type="radio" name="payment" value="credit" checked> 信用卡
          </label>
          <label>
            <input type="radio" name="payment" value="transfer"> 銀行轉帳
          </label>
          <label>
            <input type="radio" name="payment" value="cod"> 貨到付款
          </label>
        </div>
      </div>

      <div class="checkout-summary">
        <div class="checkout-summary-row">
          <span>商品小計</span>
          <span>$${total.toFixed(2)}</span>
        </div>
        <div class="checkout-summary-row">
          <span>運費</span>
          <span id="shippingFee">$0</span>
        </div>
        <div class="checkout-summary-row total">
          <span>總計</span>
          <span id="checkoutTotal">$${total.toFixed(2)}</span>
        </div>
      </div>

      <button type="submit" class="checkout-btn">確認訂單</button>
    </form>
  `;
  
  checkoutContent.innerHTML = checkoutHTML;
  
  // 配送方式變更事件
  const shippingInputs = document.querySelectorAll('input[name="shipping"]');
  shippingInputs.forEach(input => {
    input.addEventListener('change', () => {
      const shippingFee = input.value === 'express' ? 50 : 0;
      const newTotal = total + shippingFee;
      
      document.getElementById('shippingFee').textContent = `$${shippingFee}`;
      document.getElementById('checkoutTotal').textContent = `$${newTotal.toFixed(2)}`;
    });
  });
  
  // 提交表單
  const checkoutForm = document.getElementById('checkoutForm');
  checkoutForm.addEventListener('submit', (e) => {
    e.preventDefault();
    
    const formData = new FormData(checkoutForm);
    const shippingFee = formData.get('shipping') === 'express' ? 50 : 0;
    const finalTotal = total + shippingFee;
    
    // 關閉結帳彈窗
    checkoutModal.classList.remove('open');
    
    // 顯示成功頁面
    showCheckoutSuccess(cartItems, finalTotal);
  });
}

